import React, {useState} from "react";
import Fab from '@mui/material/Fab';
import CableIcon from '@mui/icons-material/Cable';
import Tooltip from "@mui/material/Tooltip";
import WebSerial from "./WebSerial";

function Serial() {
    const [connectText, setConnectText] = useState("Connect SPIKE Here: ");

    return (
        <div className="flex justify-center">
            <p className="mt-2 mx-2">{connectText}</p>
            <Tooltip title="Connect Device" placement="right">
                <Fab onClick={WebSerial} color="warning" aria-label="add" size="small">
                    <CableIcon />
                </Fab>
            </Tooltip>


        </div>
    )
}

export default Serial;
